import React from 'react';
import styled from 'styled-components';
import Helmet from 'react-helmet';

/* Scripts ---------------------------*/
import API from '../../common/axios.js';

/* Components ---------------------------*/

// import LoginForm from '../../common/Forms/LoginForm.jsx';

const formFields = {
    nameField: {
        id: 'userName',
        label: 'Name',
        inputType: 'text',
        value: '',
        validate: {
            required: true,
            valid: true,
            message: '',
        }
    },
    emailField: {
        id: 'userEmail',
        label: 'Email',
        inputType: 'email',
        value: '',
        validate: {
            required: false,
            valid: true,
            message: '',
        }
    },
    messageField: {
        id: 'userMessage',
        label: 'Message',
        inputType: 'textarea',
        value: '',
        validate: {
            required: false,
            valid: true,
            message: '',
        }
    },
}

const Login = () => {

    return (
        <LoginStyled className='Login'>
            <Helmet>
                <title>Login :: SPA App</title>
            </Helmet> 
        </LoginStyled>
    );
}

export default Login;

const LoginStyled = styled.div`

`;
